Vastgoed is de grond, de nog niet gewonnen delfstoffen, de met de grond verenigde beplantingen, evenals de gebouwen en werken die duurzaam met de grond zijn verenigd, hetzij rechtstreeks, hetzij door vereniging met andere gebouwen of werken. Vastgoed wordt ook wel onroerend goed genoemd. Voorbeelden van vastgoed zijn huizen, bedrijfspanden, winkels of fabrieken. Niet alleen de gebouwen vallen onder vastgoed, ook de bijbehorende grond zien we als onderdeel van vastgoed. 
</br>
===Toelichting domein Vastgoed===
In het domein vastgoed wordt onderscheid gemaakt tussen de fysieke wereld, de gebruiksfunctie van vastgoed en de administratieve afbakening waarbij de gebruikersfunctie van vastgoed voor woningcorporaties een essentiële rol vervult. Het bepaalt immers de samenhang hoe fysiek vastgoed wordt afgebakend met als doel om te kunnen exploiteren (verhuur en verkoop) respectievelijk te beheren (VVE-beheer) en daarvoor te kunnen administreren [1]. De complexiteit van de vastgoedpositie die de woningcorporatie heeft, is afhankelijk van de keuzes die (in het verleden door rechtsvoorgangers) zijn gemaakt :
* Is het vastgoed ontwikkeld en/of aangekocht louter met het doel om te verhuren, dan is het betrekkelijk eenvoudig geregeld;
* Is er sprake van verkoop - al dan niet in combinatie met terugkoopregelingen - dan wordt het al iets gecompliceerder, bijvoorbeeld als sprake is van erfpacht;
* Betreft het te verkopen vastgoed gestapelde bouw, dan moet vastgoed eerst worden gesplitst (zie voor meer uitleg 'Wat is gesplitst vastgoed' of de procesketen Splitsen en verkopen vastgoed) en wordt het beheer grotendeels overgedragen aan de Vereniging van Eigenaren. De woningcorporatie blijft als VVE-lid wel verantwoordelijk voor de 'binnenkant' van de verhuurbare eenheden;
* Indien 'gesplitst vastgoed' door de gemeente in erfpacht is uitgegeven, dan wordt het nog gecompliceerder als erfpacht moet worden overgedragen of door de woningcorporatie in ondererfpacht wordt uitgegeven.
</br>
Afhankelijk van de combinatie van smaken die voorkomt bij de woningcorporatie, kan het een flinke puzzel zijn om de vastgoedpositie in kaart te brengen, de verschillende belangen met elkaar uit te lijnen en grip te houden. Denk bijvoorbeeld aan het eigenaarschap van groenstroken en achterpaden. Ze vormen wel onderdeel uit van vastgoedeenheden, maar in de vastgoedsturing en het (splitsen en vervolgens) verkopen van vastgoed, worden ze nog te vaak over het hoofd gezien. Indien zij niet goed worden meegenomen bij het verkopen van vastgoed, dan loopt de woningcorporatie het risico dat zij na uitponding met reststukken grond blijft zitten en de daaruit voortkomende beheerlast. Van de referentiearchitectuur mag worden verwacht dat met al deze aspecten rekening wordt gehouden. Daarom zijn er in het domein Vastgoed bedrijfsobjecten en/of relaties opgenomen die meer toelichting behoeven:
* We maken expliciet onderscheid tussen administratieve eenheden en gebruikseenheden. Een administratieve eenheid kan immers samengesteld worden uit meerdere gebruikseenheden ongeacht of er sprake is van dezelfde of juist verschillende gebruikersfuncties [2]. Omgekeerd kan het ook zo zijn dat een gebruikseenheid meerdere administratieve eenheden betreft[3]. Er is daardoor sprake een n-op-n relatie tussen administratieve eenheden en gebruikseenheden;
* Gebruikseenheden zijn op hun beurt af te leiden van vastgoedeenheden waarbij de aard én het gebruik van het vastgoed leidend is. De afbakening van gebruikseenheden is van belang voor het strategisch en tactisch voorraadbeleid. Zo kunnen verschillende woningen binnen één gebouw/bouwblok worden afgebakend, maar beleidsmatig maakt het uit of de woning voor de doelgroep van beleid is bedoeld (DAEB) of voor de vrije sector (NIET-DAEB). Binnen het gebouw/bouwblok kunnen ze - afhankelijk van het beleid van de woningcorporatie - naast elkaar voorkomen. Parkeren is dan weer een NIET-DEAB activiteit dus als een sociale huurwoning met een parkeerplaats wordt verhuurd, dan is sprake van een combinatie van een DAEB en een NIET-DAEB verhuring;
* Een afsluitbare parkeergarage is een verblijfsobject waarvoor de bronhouder van de BAG een uniek adres uitgeeft[4], terwijl een niet-afsluitbare parkeergarage een overig gebouwd object betreft waar de bronhouder van de BAG geen adres uitgeeft;
* Een parkeerplaats is meerdere keren opgenomen omdat een parkeerplaats gesitueerd kan zijn:
** los aan de zijde van de openbare weg;
** op een parkeerterrein dat als zodanig een benoemd terrein is en dus niet adresseerbaar is;
** in een niet-afsluitbare parkeergarage dat een overig gebouwd object betreft en ook niet adresseerbaar is;
** in een afsluitbare parkeergarage dat conform de BAG een verblijfsobject is en waarvoor dus wel een uniek adres is/wordt uitgegeven;
* Een appartementsrecht dat middels een AppartementsrechtSplitsing wordt afgebakend kan betrekking hebben op hele gebouwen, een deel van een gebouw, een verblijfobject, een overig gebouwd object en/of een benoemd terrein. De Splitsingsakte en splitsingstekening zijn leidend om zicht te krijgen welke eigenaar verantwoordelijk is voor het beheer en onderhoud van betreffend (stukje van het) gebouw). Bij gesplitst vastgoed voegt het veel waarde toe om van bouwkundige elementen de eigenaar als kenmerk vast te leggen zoals die in splitsingen zijn geregeld;
* Is het perceel door de gemeente in erfpacht uitgegeven, dan kan de woningcorporatie percelen in ondererfpacht uitgeven. Indien sprake is van gesplitst vastgoed dan is hierbij ook een SpiegelsplitsingAfkoopErfpacht benodigd (zie domein kadaster).
</br>
Onzelfstandige eenheden zijn altijd gesitueerd in een verblijfsobject (bijvoorbeeld een woning). Daardoor is ook het adres een voorziening die gedeeld wordt.
</br>
#  We hanteren het uitgangspunt dat de vastgoedregistratie in het stelsel van Basisregistraties de basis vormt en door woningcorporaties wordt verrijkt met aanvullende informatie die nodig is voor het administreren van het (her)ontwikkelen, exploiteren en beheren van het vastgoed. Immers, ketenpartners van woningcorporaties maken ook maximaal gebruik van de basisregistraties waardoor informatie-uitwisseling over het vastgoed wordt vergemakkelijkt.
</br>
#  Bij het splitsen van vastgoed kan er voor zijn gekozen om een woning met een losse berging of een parkeerplaats gezamenlijk één appartement index toe te kennen om daarmee één appartementsrecht te vormen. De woning, de berging en de parkeerplaats zijn daardoor niet afzonderlijk verkoopbaar maar wel los verhuurbaar. Tegelijkertijd kan in een vergelijkbare situatie bij het splitsen van het vastgoed zijn gekozen om de woning, de berging en de parkeerplaats afzonderlijk te indexeren waardoor ze wel afzonderlijk verkoopbaar zijn. Voor het verhuren maakt het juridisch gezien niet uit welke wijze van splitsing is toegepast, want de woningcorporatie kan, zolang zij eigenaar is van het appartementsrecht, de woning, de berging en de parkeerplaats los verhuren. Als deze splitsingsvarianten naast elkaar voorkomen in de vastgoedportefeuille van de woningcorporatie (bijvoorbeeld als gevolg van fusies waar rechtsvoorgangers verschillende keuzes hebben gemaakt), kan dat veel verwarring opleveren, doch de wijze van splitsing is hiervoor leidend.
</br>
# Onzelfstandige eenheden (zoals studentenkamers) worden afzonderlijk verhuurd en zijn daardoor als administratieve eenheid te onderscheiden. Ze delen echter voorzieningen zoals het adres en maken daarmee onderdeel uit van één verblijfsobject en daarmee één gebruikseenheid.
</br>
# Er zijn bronhouders die de wet (nog) niet goed hebben toegepast. Als dat het geval is, dient hierover een melding te worden gedaan bij de bronhouder.
